import React from 'react';
import ReactDOM from 'react-dom';
import {Provider} from 'react-redux'

import TodoList from './todoList'

ReactDOM.render(
  <Provider>
      <TodoList />
  </Provider>
    ,
  document.getElementById('root')
);
